  input: TEXT,SB23,SB23.5382,"We are responding to an inquiry letter dated April 9,
    2003.  In this letter, signed by Maureen Bentiz, the FEC has indicated that a
    contribution made to 'Lewis For Congress' was incorrectly identified as for a
    primary election.  After discussion with Ms. Benitz and reviewing the check and
    documentation, it was decided that this contribution was incorrectly indicated
    on the original filing.  There was no designation made to the candidate and it
    should have been used towards their next election.  Ms. Benitz instructed us that
    we would just need to amend this report indicating on this memo that it was an
    error and the contribution should not have been designated for a primary election.  She
    indicated no other action needed to be done as this was an error and that the
    amendment with memo was sufficient to deal with this issue."
